import { TextField, Button} from "@mui/material";

export default function Form() {
  return (
    <div className="App">
      <form>
        <TextField
          style={{ width: "200px", margin: "5px", background:"white"}}
          variant="filled"
          type="text"
          label="setgoal"
        />
        <TextField
          style={{ width: "200px", margin: "5px", background:"white"}}
          variant="filled"
          type="text"
          label="goal description"
        />
        {/* <br /> */}
        {/* <Checkbox label="Diversity catagory" /> */}


        <br />
        <TextField
          id="outlined-multiline-static"
          style={{ width: "415px", margin: "5px", background:"white" }}
          variant="filled"
          type="text"
          label="job region"
          multiline
          rows={10}
        />
        <br />
        <Button variant="contained" color="primary">
          save
        </Button>
      </form>
    </div>
  );
}
